//--------------------------------------------------------------------------------------//
//                                       Projects.js                                       //
//--------------------------------------------------------------------------------------//


import React, { useState } from 'react';
import Slider from "react-slick";
// import Carousel from 'react-round-carousel';
import Carousel from './Carousel.tsx';
import 'react-round-carousel/dist/index.css'; // Import the carousel CSS
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import DarkModeToggle from '../NavigationBar/DarkModeToggle';
import './Projects.css';
import personal_project1 from '../images/project_images/maplestory_app.gif';
import personal_project2 from '../images/project_images/invaded_space.gif';
import personal_project3 from '../images/project_images/bullseye.png';
import hackathon1 from '../images/project_images/lyric_link.gif';
import hackathon2 from '../images/project_images/att_empowher.png';
import hackathon3 from '../images/project_images/datafest.png';
import coursework_project3 from '../images/project_images/turing_machines.png';
import coursework_project1 from '../images/project_images/data_visualization.png';

// Array of slides to use for slideshow pictures
const project_data = [
    { 
        image: hackathon1, 
        description: "lyric link test filler test test beep boop bert bert bert",
        captions: [
            { text: 'SacHacks', style: { } },
            { text: 'React', style: { backgroundColor: 'blue'} },
            { text: 'Django', style: { backgroundColor: 'blue'} }
        ]
    },
    { 
    image: hackathon2, 
    captions: [
        { text: 'AT&T: EmpowHer', style: { backgroundColor: ''} },
        { text: 'HTML', style: { backgroundColor: 'green'} },
        { text: 'CSS', style: { backgroundColor: 'green'} },
    ]

    },
    { 
    image: hackathon3, 
    captions: [
        { text: 'Datafest', style: { } },
        { text: 'Pandas', style: { backgroundColor: 'blue'} },
        { text: 'Python', style: { backgroundColor: 'green'} }
    ]
    },
    { 
    image: personal_project1, 
    captions: [
        { text: 'Maplestory', style: { } },
        { text: 'Flutter', style: { backgroundColor: 'blue'} },
        { text: 'Dart', style: { backgroundColor: 'green'} }
    ] 
    },
    { 
    image: personal_project2, caption: 'Invaded Space',
    captions: [
        { text: 'Game Jam', style: { } },
        { text: 'Unity', style: { backgroundColor: 'blue'} },
        { text: 'C#', style: { backgroundColor: 'green'} }
    ]  
    },
    { 
    image: personal_project3, caption: 'Bullseye', 
    captions: [
        { text: 'Bullseye', style: { } },
        { text: 'SwiftUI', style: { backgroundColor: 'blue'} },
        { text: 'Swift', style: { backgroundColor: 'green'} }
    ]    
    },
];

function Projects() {
    // Map your project data to the format expected by the carousel
    const carouselItems = project_data.map((project, index) => ({
        image: project.image,
        content: (
        <div key={index}>
            <p>{project.description}</p>
            <div>
            {project.captions.map((caption, capIndex) => (
                <span key={capIndex} style={caption.style}>
                {caption.text}
                </span>
            ))}
            </div>
        </div>
        ),
        // Add other properties if the carousel requires
    }));

    return (
        <div className="projects" id="projects">
        <h1>Projects</h1>
        <div className="projects__section">
            {/* The carousel component */}
            <Carousel items={carouselItems} /* other props */ />
            <DarkModeToggle /* ... */ />
            {/* Any other components */}
        </div>
        </div>
    );
    }

export default Projects;
